import React from "react";
import ReactDOM from "react-dom";
import { add, sub, mult, div } from "./App";
import cricket from "./images/cricket.mp4";
import "./index.css";

ReactDOM.render(
  <>
    <div>
      <video src={cricket} autoPlay loop muted />
    </div>
    <p1 className="overlay">
      <li>Sum = {add(10, 10)}</li>
      <li>Sub = {sub(20, 10)}</li>
      <li>div = {div(5, 5)}</li>
      <li>Product = {mult(10, 10)}</li>
    </p1>
  </>,
  document.getElementById("root")
);
